// ==UserScript==
// @name        MeetMe Photo Enlarger 
// @namespace   MeetMe
// @description Script to show the large images on MeetMe pages
// @include     http://www.meetme.com/?mysession=
// @version     1
// @grant       none
// @icon		data:image/jpeg;base64,%3D
// ==/UserScript==

//Array of blocked domains
var blockedDomains = ['content1.myyearbook.com/thumb_userimages/'];

//Prefix of the prefered proxy service
var proxyPrefix = 'large/';


var images = document.getElementsByTagName('img');
for (var i = 0; i < images.length; i++) {
    image = images[i];
    for (var j = 0; j < blockedDomains.length; j++) {
        domain = 'http://' + blockedDomains[j];
        if (image.src.match(domain)) {
            image.src = image.src.replace(domain, domain + proxyPrefix);
        }	
    }
}